import React from "react";

// import material-ui components
import { makeStyles } from "@material-ui/core/styles";
import { Box, Grid } from "@material-ui/core";

// custom css styling
const useStyles = makeStyles({
  view: {
    height: "50vh"
  },
  fontSize: {
    fontSize: "40px"
  }
});

function Contact() {
  const classes = useStyles();

  return (
    <>
      <Box display="flex" justifyContent="center" id="contact">
        <h1 style={{ fontSize: "30px" }}>Get in Touch</h1>
      </Box>
      <Grid
        container
        direction="row"
        justify="center"
        alignItems="center"
        className={classes.view}
      >
        <Grid
          item
          xs={12}
          align="center"
          data-aos="fade-right"
          data-aos-offset="300"
          data-aos-easing="ease-in-sine"
        >
          <i class="fab fa-github" style={{ marginRight: "1rem" }}></i>
          <a
            href="https://www.github.com/jaykim92"
            target="_blank"
            rel="noopener noreferrer"
            className={classes.fontSize}
          >
            Github
          </a>
        </Grid>
        <Grid
          item
          xs={12}
          align="center"
          data-aos="fade-right"
        >
          <i class="fab fa-linkedin" style={{ marginRight: "1rem" }}></i>
          <a
            href="https://www.linkedin.com/in/jaykim92"
            target="_blank"
            rel="noopener noreferrer"
          >
            LinkedIn
          </a>
        </Grid>
      </Grid>
    </>
  );
}

export default Contact;
